import '../css/TextInput.css';
import React from 'react';

const TextInput = (props) => {
  const { label, value, onChange } = props;

  return (
    <div className='text-input-wrapper'>
      <label>{label}</label>
      <input
        type='text'
        placeholder={"Enter text here..."}
        value={value}
        onChange={onChange}
      />
    </div>
  );
};

export default TextInput;
